import React, { Fragment } from "react";
import styled from "styled-components";

const Container = styled.div`
  height: 30%;
  padding: 0 2rem;
  width: 100%;
  box-shadow: #e9e9e9 0px 1px 4px;
  margin: 30px 0;
`;

const SearchFormFields = [
  {
    type: "text",
    name: "min",
    placeholder: "Min",
    label: "Amount",
  },
  {
    type: "text",
    name: "max",
    placeholder: "Max",
    label: "",
  },
  {
    type: "text",
    name: "binNumber",
    placeholder: "Bin Num",
    label: "BIN Number",
  },
  {
    type: "email",
    name: "email",
    placeholder: "Email",
    label: "Email",
  },
];

export const FormGroup = styled.div``;
export const FormDesc = styled.h3`
  color: #888;
`;

export const Input = styled.input`
  height: 32px;
  padding: 5px 12px;
  border-radius: 4px;
  border: solid 1px rgba(0, 0, 0, 0.15);
  background-color: #ffffff;
  width: ${(props) => props.width};
`;

const SecondSearchRow = styled.form`
  display: flex;
`;

const Select = styled.select`
  width: 190px;
  height: 32px;
  margin: 8px 0 0;
  padding: 5px 12px;
  border-radius: 4px;
  border: solid 1px rgba(0, 0, 0, 0.15);
  background-color: #ffffff;
`;

const Wrapper = styled.div`
  display: flex;
  flex-direction: column;
  margin: 0 1rem;
`;

const Search = () => {
  return (
    <Container>
      <Input
        type="text"
        name="transactionId"
        width="272px"
        //   onChange={(e) => onChange(e)}
        placeholder="Search Trans ID"
        //   value={formData[name]}
        style={{ marginBottom: "1.5rem" }}
      />
      <SecondSearchRow>
        <Wrapper>
          <FormDesc>Decision</FormDesc>
          <Select>
            <option value="0">first</option>
            <option value="1">second</option>
            <option value="2">third</option>
          </Select>
        </Wrapper>
        <Wrapper>
          <FormDesc>Payment</FormDesc>
          <Select>
            <option value="0">first</option>
            <option value="1">second</option>
            <option value="2">third</option>
          </Select>
        </Wrapper>

        {SearchFormFields.map((formField, index) => {
          const { type, name, placeholder, label } = formField;
          return (
            <Wrapper key={index}>
              <FormDesc>{label}</FormDesc>
              <Input
                type={type}
                name={name}
                //   onChange={(e) => onChange(e)}
                placeholder={placeholder}
                //   value={formData[name]}
              />
            </Wrapper>
          );
        })}
        {/* <Button onClick={(e) => onSubmit(e)}>
          Submit
        </Button> */}
      </SecondSearchRow>
    </Container>
  );
};

export default Search;
